.editor * {
  font-kerning: none !important;
  -webkit-font-smoothing: antialiased !important;
  -moz-osx-font-smoothing: grayscale !important;
  -moz-font-smoothing: grayscale !important;
  text-rendering: optimizeLegibility !important;
}
.editor .syntax--comment {
  font-style: normal !important;
}
.editor .syntax--hyperlink {
  text-decoration: none !important;
}
.editor .cursor {
  border-color: lime !important;
}
.editor .cursors {
  opacity: 1 !important;
}
.editor .cursors.blink-off {
  opacity: 0 !important;
}
.editor .bracket-matcher .region {
  opacity: 1 !important;
  border-bottom-color: lime !important;
  border-bottom-style: solid !important;
}
.editor .gutter.line-numbers {
  opacity: 1 !important;
}
.editor .gutter.line-numbers .line-number.bracket-matcher {
  opacity: 1 !important !important;
}
.editor .gutter.line-numbers .line-number.cursor-line {
  opacity: 1 !important;
}
.editor .gutter.line-numbers .line-number.cursor-line.cursor-line-no-selection {
  opacity: 1 !important;
}
.status-bar .github-StatusBarTile,
.status-bar .line-ending-tile {
  display: none !important;
}
.tool-bar .btn {
  min-width: 2% !important;
  height: auto !important;
  min-height: auto !important;
  line-height: normal !important;
  border: none !important;
  background: transparent !important;
  border-radius: 0 !important;
  margin-top: 0 !important;
  margin-right: 0 !important;
  margin-bottom: 0 !important;
  margin-left: 0 !important;
  vertical-align: middle !important;
}
.tool-bar .btn:before {
